import React from "react";
import { Typography } from "@mui/material";

const Balance = ({ account, accountNumber }) => {
  return (
    <div style={{ border: "2px solid grey", padding: 16, width: 600 }}>
      <Typography variant="h5" color="grey">
        ACCOUNT {accountNumber}
      </Typography>
      EUR:{account["EUR"]}
      <br />
      USD:{account["USD"]}
    </div>
  );
};

export default Balance;
